import React from "react"
import { ToDoData } from "./DoData"

export interface ToDoProps {
    todo: ToDoData
    checker: (
        // event: React.MouseEvent<HTMLInputElement, MouseEvent>,
        item: ToDoData
    ) => void
}

const ToDo = ({ todo, checker }: ToDoProps) => {
    return <li >
        <input
            type="checkbox"
            onClick={(event) => { checker(todo) }}
        />
        {todo.text}
    </li>
}

export default ToDo
